{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyPcAR6aPt+dOGcWG7biG/ov"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":5,"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":521},"id":"21tM7yf2LWk-","executionInfo":{"status":"ok","timestamp":1734902079521,"user_tz":-120,"elapsed":6035,"user":{"displayName":"Ярослав Білотіл","userId":"06797585363548962278"}},"outputId":"9f2b9c47-d63c-4059-ddcf-4b5a6dc3dd42"},"outputs":[{"output_type":"stream","name":"stdout","text":["\n","ADABOOST REGRESSOR\n","Mean squared error = 1.18\n","Explained variance score = 0.47\n"]},{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}],"source":["import numpy as np\n","import matplotlib.pyplot as plt\n","from sklearn.tree import DecisionTreeRegressor\n","from sklearn.ensemble import AdaBoostRegressor\n","from sklearn import datasets\n","from sklearn.metrics import mean_squared_error, explained_variance_score\n","from sklearn.model_selection import train_test_split\n","from sklearn.utils import shuffle\n","\n","# Завантажуємо набір даних про житло в Каліфорнії\n","housing_data = datasets.fetch_california_housing()\n","X, y = shuffle(housing_data.data, housing_data.target, random_state=7)\n","\n","# Розділення даних на тренувальні та тестові\n","X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.2, random_state=7)\n","\n","# Модель на основі AdaBoost регресора\n","regressor = AdaBoostRegressor(DecisionTreeRegressor(max_depth=4),\n","                              n_estimators=400, random_state=7)\n","regressor.fit(X_train, y_train)\n","\n","# Обчислення показників ефективності регресора AdaBoost\n","y_pred = regressor.predict(X_test)\n","mse = mean_squared_error(y_test, y_pred)\n","evs = explained_variance_score(y_test, y_pred)\n","\n","print(\"\\nADABOOST REGRESSOR\")\n","print(\"Mean squared error =\", round(mse, 2))\n","print(\"Explained variance score =\", round(evs, 2))\n","\n","# Отримуємо важливість ознак\n","feature_importances = regressor.feature_importances_\n","feature_names = housing_data.feature_names\n","\n","# Нормалізація значень важливості ознак\n","feature_importances = 100.0 * (feature_importances / max(feature_importances))\n","\n","# Сортування та перестановка значень\n","index_sorted = np.flipud(np.argsort(feature_importances))\n","\n","# Розташування міток вздовж осі X\n","pos = np.arange(index_sorted.shape[0]) + 0.5\n","\n","# Побудова стовпчикової діаграми\n","plt.figure()\n","plt.bar(pos, feature_importances[index_sorted], align='center')\n","\n","# Оскільки 'feature_names' є списком, а індекси повертаються як масив, виправимо відображення\n","plt.xticks(pos, [feature_names[i] for i in index_sorted])\n","plt.ylabel('Relative Importance')\n","plt.title('Estimation of feature importance using AdaBoost regressor')\n","plt.show()\n"]}]}